import React, { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";
import { doc, getDoc, setDoc } from "firebase/firestore";
import db from "../firebaseConfig";

const FinalPage = () => {
  const location = useLocation();
  const { reportName } = location.state;

  const [data, setData] = useState({
    dimensions: [],
    metric: null,
    refreshTime: "",
    queryResults: null,
    timestamp: null, // To store the timestamp from Firestore
  });

  const metricAliases = {
    totalUsers: "total_users",
    revenue: "total_revenue",
    eventCount: "total_events",
    views: "total_views",
  };

  useEffect(() => {
    const fetchData = async () => {
      try {
        // Fetch the document from Firestore
        const docRef = doc(db, "reports", reportName);
        const docSnap = await getDoc(docRef);

        if (docSnap.exists()) {
          const firestoreData = docSnap.data();

          // Check if data is still fresh based on refreshTime
          const savedTime = new Date(firestoreData.timestamp);
          const currentTime = new Date();
          const refreshTimeInMinutes = parseInt(
            firestoreData.refreshTime.split(" ")[0]
          );
          const timeDifference = (currentTime - savedTime) / (1000 * 60);

          if (timeDifference <= refreshTimeInMinutes) {
            // Data is still fresh, use it directly
            setData({
              dimensions: firestoreData.dimensions || [],
              metric: firestoreData.metric || null,
              refreshTime: firestoreData.refreshTime || "",
              queryResults: firestoreData.results || null,
              timestamp: firestoreData.timestamp,
            });
            return; // No need to fetch from BigQuery
          } else {
            // Data is stale, fetch from BigQuery
            const dimensions = firestoreData.dimensions || [];
            const metric = firestoreData.metric || null;
            const refreshTime = firestoreData.refreshTime || "";

            const bqResponse = await fetch(
              "http://localhost:3001/query-bigquery",
              {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify({
                  dimensions,
                  metric,
                  refreshTime,
                }),
              }
            );

            const bigqueryData = await bqResponse.json();

            // Update Firestore with the new results and timestamp
            await setDoc(docRef, {
              ...firestoreData,
              results: bigqueryData,
              timestamp: new Date().toISOString(),
            });

            setData({
              dimensions,
              metric,
              refreshTime,
              queryResults: bigqueryData,
              timestamp: new Date().toISOString(),
            });
          }
        } else {
          console.log("No such document!");
          // Handle the case where the document doesn't exist
        }
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, [reportName]);

  return (
    <div>
      <h1>Final Page</h1>

      <h2>{fileData.reportName}'s Report</h2>

      <h2>Query Results:</h2>

      {/* Conditionally render the table if data is available */}
      {data.queryResults && data.queryResults.length > 0 ? (
        <table>
          <thead>
            <tr>
              {/* Dynamically create table headers */}
              {data.dimensions.map((dimension) => (
                <th key={dimension}>{dimension}</th>
              ))}
              <th>{metricAliases[data.metric]}</th>
            </tr>
          </thead>
          <tbody>
            {/* Dynamically render table rows */}
            {data.queryResults.map((row, rowIndex) => (
              <tr key={rowIndex}>
                {data.dimensions.map((dimension) => (
                  <td key={`${rowIndex}-${dimension}`}>{row[dimension]}</td>
                ))}
                <td>{row[metricAliases[data.metric]]}</td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>{data.queryResults ? "No data found." : "Loading data..."}</p>
      )}

      {/* Display other relevant information (optional) */}
      <p>Dimensions: {data.dimensions.join(", ")}</p>
      <p>Metric: {data.metric}</p>
      <p>Refresh Time: {data.refreshTime}</p>
      {/* You can add more information as needed */}
    </div>
  );
};

export default FinalPage;
